def most_frequent_element(lst):
    freq_count = {}
    max_freq = 1
    most_freq_element = None
    for num in lst:
        if num not in freq_count:
            freq_count[num] = 1
        else:
            freq_count[num] += 1
        if freq_count[num] > max_freq:
            max_freq = freq_count[num]
            most_freq_element = num
    return most_freq_element

